    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - 78 BETWEEN ( + col2 ) * + 91 * + ( + col0 ) - 50 AND + ( - col1 );
  - name: tab2

outputs:
  - name: q8412.out
    data: |
      46	51	23
      64	77	40
      75	67	58
